import React from 'react';
import "./_trips.scss"

const Trips = ({title, image, text, country, link}) => {
    return (
        <>
            <div className="trips_box box">
                <a href={link} target={"_blank"} className="trips_box_link">
                    <div className="trips_box_left">
                        <h2 className="trips_header">{title}</h2>
                        <p className="trips_text">{text}</p>
                        <h2 className="trips_header">Kraje:</h2>
                        <div className="trips_country">{country}</div>
                    </div>
                </a>
            </div>

            <div className="films_box box">
                <a href={link} target={"_blank"} className="films_box_link">
                    <img className="films_image" src={image} alt="image" />
                    <h2 className="films_header">{title}</h2>
                    <p className="films_text">{text}</p>
                </a>
            </div>
        </>
    );
};

export default Trips;
